import React, {useEffect, useState} from 'react';
import UsersService from '../services/UsersService';

export const ProfilePage = () => {
	const [user, setUser] = useState({});

	useEffect(() => {
		async function fetch_user() {
			const response = await UsersService.get_user_details(sessionStorage.getItem("userToken"));
			setUser(response.user);
		}
		fetch_user();
	})

	return (
		<div>
            <h1 className="center_elem">My Profile</h1>
            <table className="medium_window center_elem border">
            	<tbody>
					<tr>
                       <td><label>Username:</label></td><td><label>{user.username}</label></td>
    	            </tr>
					<tr>
                       <td><label>Hashed Password:</label></td><td><label>{user.password}</label></td>
    	            </tr>

            	    {/* <tr>
                       <td><label>Full Name:</label></td><td><label>{user.full_name}</label></td>
    	            </tr>
    	            <tr>
        	        	<td><label>Username:</label></td><td><label>{user.username}</label></td>
            	    </tr>
            	    <tr>
 						<td><label>ID:</label></td><td><label>{user.id}</label></td>
            	    </tr>
            	    <tr>
 						<td><label>Role:</label></td><td><label>{user.role}</label></td>
            	    </tr>
                    <tr>
 						<td><label>Joined:</label></td><td><label>{user.creation_date}</label></td>
            	    </tr> */}
            	</tbody>
            </table>
        </div>
	)
}

